Day 2 #AloMovesGoals
Splitssss!
When I first began my practice of yoga (in 2017) never did I think I would be able to get the splits! Especially, in my 30s. I’ve always had really tight hips and I’ve had to work really hard at lengthening the muscles and mobilizing joints. One of my top goals (still) is getting middle splits, which I haven’t progressed in years, but I also haven’t dedicated a consistent practice to it. 
Front splits came way easier than I thought. I think because there’s so much forward folding happening in a vinyasa sequence (which I teach). 
I hear often from students that front splits is a major goal for them. What about you? Is splits a goal? Do you practice consistently? And if you have your splits, did it come easily for you?

