My absolute faaaaavourite shoulder opener! 
pincha with a gaze drop 🙌🏻

Another place I have to work real hard at keeping open. My heart and shoulders. You’ll notice in my handstands I don’t have a straight alignment. My shoulder joints and thoracic spine have limited mobility (I don’t know why 🤷🏻‍♀️)
Which actually makes handstanding and forearm stands so much harder! There’s more muscle engagement than there is bone strength when you don’t have straight alignment (I don’t know why I Gotta make things harder for myself 😅) So when I was found a pose that gets deep and juicy into those joints, oh I fell in love, and over and over I go back to this pose. 

So if you’re finding it difficult to stack in your handstand, and perhaps getting your shoulders a bit more open will help. 
