This is one of my FAVOURITE memories ✨. A weekend spent with one of my BEST girlfriends and her family at their lake. Her and I hadn’t seen each other in over 15 years. When I arrived at her lake (like no time had passed) we hopped in their very decorated golf cart for a “Christmas🎅🏼 in August” themed parade. Our cheeks hurt from smiling 😄and waving as the excited Kiddos from the campground eagerly, scooped up the treats 🍬her children tossed out as we winded through the campground in a train 🚂 of, over 20 decorated “floats” (golf carts).
We headed down to the beach after, the sunset was absolute fire 🔥. As we watched the sunset on the beach, just off in the distance, kids laughing on their paddleboards and unicorn 🦄 floaty. It was all very dream-y like 😌. Once the sun went down, Her, I, and her oldest kiddo hopped on the golf cart again and set out to play the most intense game of Mantracker through the campground, chasing teenagers and laughing our asses off. (We may have even peed our pants a little bit 🙊). Fireworks 🎆 by the water and sweet cuddle with her pup 🐶 by the fire ended a perfect day. The Jeep was my sleeping 😴 quarters for the night, where I zenfully cozied up in the comfiest bed 🛌. The following day we begin with a sweet cacao 🍫ceremony nestled in the trees, yoga 🧘🏻‍♀️ and meditation, and after a BBQ lunch we got on the water for tubing 🏄🏻‍♀️ and soaked up the last of our glorious moments before the weekend ended. 

I'm looking forward to all that Summer ☀️ 2023 will bring and I hope it will be a sweet as 2022 was 💝. Thank you @thestaceyfoley for being you 🫶🏻

