-Our brains are composed of over 86 million neurons firing constantly. 
-We have 60,000-80,000 thoughts per DAY!
-Mostly repetitive (95%)
-We have LOTS of negative thoughts too like: I shouldn’t have done/said that. I could never do that. *blank* is hard.

This loop happens. The more you think something the more you think something. Habitual thoughts, create neural pathways, like little grooves to each other.

The great news is, choosing new behaviors, thinking positive thoughts, and trying new things creates NEW neural pathways.
Even better news is - continue to do think and try and you deepen in the new  grooves. 
Just like exercise, you have to do it often. Keep practicing. Keep growing. Keep expanding. Keep trying. Better every day I say. 🫶🏻✨

